import { Link } from 'react-router-dom';
import React from 'react';
import penguin from '../../public/images/penguin-walk.gif'

function Error (){
  return (
    <>
      <h2>404</h2>
      <p>page not found</p>
      <img src={penguin} alt="penguin" />
      <Link to='/'>back home</Link>
    </>
  );
}

export default Error;
